                if (WoW.CanCast("OdynsFury") && WoW.PlayerHasBuff("BattleCry"))
                {
                    WoW.CastSpell("OdynsFury");
                    return;
                }
                if (WoW.CanCast("Raging Blow") && WoW.PlayerHasBuff("BattleCry"))
                {
                    WoW.CastSpell("Raging Blow");
                    return;
                }
            }

            if (combatRoutine.Type == RotationType.SingleTarget) // Do Single Target Stuff here
            {
                if (WoW.HasTarget && WoW.TargetIsEnemy && WoW.IsSpellInRange("Bloodthirst"))
                {
                    if (WoW.CanCast("Execute") && WoW.TargetHealthPercent <= 20 && WoW.PlayerHasBuff("SenseDeath"))
                    {
                        WoW.CastSpell("Execute");
                        return;
                    }
                    if (WoW.CanCast("Execute") && WoW.TargetHealthPercent <= 20 && WoW.Rage >= 25 && (!WoW.PlayerHasBuff("Juggernaut") || WoW.PlayerBuffTimeRemaining("Juggernaut") <= 2))
                    {
                        WoW.CastSpell("Execute");
                        return;
                    }
                    if (WoW.CanCast("Raging Blow") && WoW.PlayerHasBuff("Enrage") && !WoW.PlayerHasBuff("Juggernaut"))
                    {
                        WoW.CastSpell("Raging Blow");
                        return;
                    }
                    if (WoW.CanCast("Rampage") && WoW.PlayerHasBuff("Massacre") && (WoW.PlayerBuffTimeRemaining("Enrage") < 2 || !WoW.PlayerHasBuff("Enrage")))
                    {
                        WoW.CastSpell("Rampage");
                        return;
                    }
                    if (WoW.CanCast("Rampage") && WoW.Rage >= 100 && (WoW.TargetHealthPercent > 20 || (WoW.TargetHealthPercent < 20 && !Massacre)))
                    {
                        WoW.CastSpell("Rampage");
                        return;
                    }
                    if (WoW.CanCast("Rampage") && ((WoW.Rage >= 85 && Massacre) || (WoW.Rage >= 70 && !Massacre)) && !WoW.PlayerHasBuff("Enrage") && !WoW.PlayerHasBuff("Juggernaut"))
                    {
                        WoW.CastSpell("Rampage");
                        return;
                    }
                    if (WoW.CanCast("Execute") && WoW.TargetHealthPercent <= 20 && WoW.Rage >= 25 && (WoW.PlayerHasBuff("Enrage") || WoW.PlayerHasBuff("BattleCry")))
                        //buff.stone_heart.react||(buff.juggernaut.up&buff.juggernaut.remains<3)
                    {
                        WoW.CastSpell("Execute");
                        return;
                    }
                    if (WoW.CanCast("Raging Blow"))
                    {
                        WoW.CastSpell("Raging Blow");
                        return;
                    }
                    if (WoW.CanCast("Bloodthirst"))
                    {
                        WoW.CastSpell("Bloodthirst");
                        return;
                    }
                    if (WoW.CanCast("Whirlwind") && WoW.PlayerHasBuff("Wrecking Ball"))
                    {
                        WoW.CastSpell("Whirlwind");
                        return;
                    }
                    if (WoW.CanCast("Execute") && WoW.TargetHealthPercent <= 20 &&
                        (WoW.Rage > 50 || (WoW.Rage >= 25 && WoW.PlayerHasBuff("BattleCry")) || (WoW.TargetHealthPercent <= 10 && WoW.Rage >= 25)))
                    {
                        WoW.CastSpell("Execute");
                        return;
                    }
                    if (WoW.CanCast("Furious Slash") && !WoW.CanCast("Bloodthirst") && !WoW.CanCast("Raging Blow"))
                    {
                        WoW.CastSpell("Furious Slash");
                        return;
                    }
                }
            }
            if (combatRoutine.Type == RotationType.SingleTargetCleave) // Do AOE Stuff here     
            {
                if (WoW.HasTarget && WoW.TargetIsEnemy && WoW.IsSpellInRange("Bloodthirst"))
                {
                    if (WoW.CanCast("DragonRoar") && !WoW.PlayerHasBuff("DragonRoarBuff")) //cooldown.battle_cry.remains<1|cooldown.battle_cry.remains>10
                    {
                        WoW.CastSpell("DragonRoar");
                        return;
                    }
                    if (WoW.CanCast("BattleCry") && WoW.PlayerHasBuff("DragonRoarBuff"))
                    {
                        WoW.CastSpell("BattleCry");
                        return;
                    }
                    if (WoW.CanCast("OdynsFury") && WoW.PlayerHasBuff("DragonRoarBuff"))
                    {
                        WoW.CastSpell("OdynsFury");
                        return;
                    }
                    if (WoW.CanCast("Whirlwind") && !WoW.PlayerHasBuff("Meat-Cleaver"))
                    {
                        WoW.CastSpell("Whirlwind");
                        return;
                    }
                    if (WoW.CanCast("Rampage") && !WoW.PlayerHasBuff("Enrage") && WoW.Rage >= 70 || (WoW.Rage >= 100) && WoW.PlayerHasBuff("Meat-Cleaver"))
                        //if=buff.enrage.down|(rage=100&buff.juggernaut.down)|buff.massacre.up
                    {
                        WoW.CastSpell("Rampage");
                        return;
                    }
                    if (WoW.CanCast("Bloodthirst") && !WoW.PlayerHasBuff("Enrage") && WoW.PlayerHasBuff("Meat-Cleaver"))
                    {
                        WoW.CastSpell("Bloodthirst");
                        return;
                    }
                    if (WoW.CanCast("Raging Blow"))
                    {
                        WoW.CastSpell("Raging Blow");
                        return;
                    }
                    if (WoW.CanCast("Whirlwind") && WoW.PlayerHasBuff("Wrecking Ball"))
                    {
                        WoW.CastSpell("Whirlwind");
                        return;
                    }
                    if (WoW.CanCast("Whirlwind") && (WoW.IsSpellOnCooldown("Bloodthirst") || WoW.IsSpellOnCooldown("Raging Blow")) &&
                        ((!WoW.PlayerHasBuff("Enrage") && WoW.Rage <= 70) || WoW.Rage <= 99))
                    {
                        WoW.CastSpell("Whirlwind");
                        return;
                    }
                }
            }
            if (combatRoutine.Type == RotationType.AOE) // Do AOE Stuff here     
            {
                if (WoW.HasTarget && WoW.TargetIsEnemy && WoW.IsSpellInRange("Bloodthirst"))
                {
                    if (WoW.CanCast("DragonRoar") && !WoW.PlayerHasBuff("DragonRoarBuff")) //cooldown.battle_cry.remains<1|cooldown.battle_cry.remains>10
                    {
                        WoW.CastSpell("DragonRoar");
                        return;
                    }
                    if (WoW.CanCast("BattleCry") && WoW.PlayerHasBuff("DragonRoarBuff"))
                    {
                        WoW.CastSpell("BattleCry");
                    }
                    if (WoW.CanCast("OdynsFury") && WoW.PlayerHasBuff("DragonRoarBuff"))
                    {
                        WoW.CastSpell("OdynsFury");
                        return;
                    }
                    if (WoW.CanCast("Whirlwind") && !WoW.PlayerHasBuff("Meat-Cleaver"))
                    {
                        WoW.CastSpell("Whirlwind");
                        return;
                    }
                    if (WoW.CanCast("Rampage") && !WoW.PlayerHasBuff("Enrage") && WoW.Rage >= 70 || (WoW.Rage >= 100) && WoW.PlayerHasBuff("Meat-Cleaver"))
                        //if=buff.enrage.down|(rage=100&buff.juggernaut.down)|buff.massacre.up
                    {
                        WoW.CastSpell("Rampage");
                        return;
                    }
                    if (WoW.CanCast("Bloodthirst") && !WoW.PlayerHasBuff("Enrage") && WoW.PlayerHasBuff("Meat-Cleaver"))
                    {
                        WoW.CastSpell("Bloodthirst");
                        return;
                    }
                    if (WoW.CanCast("Raging Blow"))
                    {
                        WoW.CastSpell("Raging Blow");
                        return;
                    }
                    if (WoW.CanCast("Whirlwind") && WoW.PlayerHasBuff("Wrecking Ball"))
                    {
                        WoW.CastSpell("Whirlwind");
                    }
                }
            }
        }
    }
